import React,{ useRef ,useEffect,useState}  from 'react';
import { motion, useTransform, useScroll } from "framer-motion";
import Navbar from './Navbar';
import '../styles/Home.css'; // Import the CSS file
import Wave from '../assets/wave.png'
import { useNavigate } from 'react-router-dom';
import Slider from './Slider.js'
import Google from '../assets/google.png';
import Microsoft from '../assets/microsoft.png';
import SplitSection from './SplitSection.js';
import ProjectImage from '../assets/projectImage.png';


const App = () => {
  const navigate = useNavigate();





  return (


    <div>

      <Navbar />

      {/* Section 1 */}
      <div className="section section1" style={{ backgroundImage: `url(${Wave})` }}>
        <div className="left-part">
            <h2>I'm Aspiring Data Analyst With Strong Analytical Skills, Committed to Transforming Data into Actionable Insights.</h2>

            </div>

            {/* Right Part */}
            <div className="right-part">

            </div>
      </div>

      {/* Section 2 */}

      <div className="section section2">
        <h1>
          I Excel in Crafting Powerful Analytics Projects, Business Intelligence Dashboards, and Insightful Data  Reports.
        </h1>



          <button onClick={
            ()=>navigate('/projects')
          }>
            Explore Projects
          </button>

      </div>

      <div>

      </div>
       <div>

       </div>
      {/* Section 3 */}

      {/* <div className="section section3">
        <Slider/>
      </div>
      */}

      <div className="section section3">
        <div className="subsection1">
          <h1 style={{color:'White',alignSelf:'Center'}}>Featured Work</h1>
        </div>
        <div>
          <img src={ProjectImage} alt="ProjectImage"/>
        </div>
        <div className="subsection2">
          <h2 >Interactive Business Intellegent Dashbord for Takwandodrillscompany  to analyse <br/>financial reports,company performance and sales.</h2>
          <button >View Dashbord</button>
        </div>

      </div>



      {/* Section 4 */}
      <div className="section section4">
          <h1>I'm Certified With.</h1>
          <div className="Certifications">
             <div className="CertiSubContainer">
                 <img src={Google}/>
                 <h3>Google Data Analys</h3>
             </div>

             <div className="CertiSubContainer">
                 <img src={Microsoft}/>
                 <h3>Microsoft Data Analyst Associate</h3>
             </div>

             <div className="CertiSubContainer">
                 <img src={Microsoft}/>
                 <h2>Data Camp SQL Expert</h2>
             </div>
          </div>
      </div>

      {/* Section 5 */}
      <div className="section section5">
        {/* Content for Section 5 */}
      </div>
    </div>


  );
};



export default App;
